import styles from './background.module.css'
import ParallaxMousemove from 'react-parallax-mousemove'

export default function Background() {

    const style = {
        outter: {

        },
        inner: {
          width:700,
          height:500,
          position: 'absolute',
          margin:0,
          top:0,
          left:0,
          right:0,
          bottom:0,
          textAlign:'center'
        },
        bgLayerStyle: {
            position: 'absolute',
            height: '100vh',
        },
        infoLayerStyle: {
            position: 'absolute',
            height: '100vh',
        },
    }

    return (
        <div>
           <ParallaxMousemove containerStyle={style.outter} fullHeight={true}>

            <ParallaxMousemove.Layer layerStyle={style.bgLayerStyle} config={{
                xFactor: -0.03,
                yFactor: 0.03,
                springSettings: {
                    stiffness: 50,
                    damping: 30
                }
                }}>

                <div className={styles.contenedor_img}>
                    <img className={styles.shadow} src="/background_parallax/shadow.png" alt="Background"></img>
                </div>

            </ParallaxMousemove.Layer>

            <div style={style.outter}>

                <ParallaxMousemove.Layer layerStyle={style.infoLayerStyle} config={{
                    xFactor: 0.03,
                    yFactor: -0.03,
                    springSettings: {
                        stiffness: 50,
                        damping: 30
                    }
                    }}>

                    <div className={styles.contenedor_img}>
                        <img className={styles.img_style} src="/background_parallax/layer_3.png" alt="Parallax Layer"></img>
                    </div>

                </ParallaxMousemove.Layer>

                <ParallaxMousemove.Layer layerStyle={style.infoLayerStyle} config={{
                    xFactor: 0.06,
                    yFactor: -0.03,
                    springSettings: {
                        stiffness: 50,
                        damping: 30
                    }
                    }}>

                    <div className={styles.contenedor_img}>
                        <img className={styles.img_style} src="/background_parallax/layer_2.png" alt="Parallax Layer"></img>
                    </div>
                </ParallaxMousemove.Layer>

                <ParallaxMousemove.Layer layerStyle={style.infoLayerStyle} config={{
                    xFactor: 0.09,
                    yFactor: -0.03,
                    springSettings: {
                        stiffness: 50,
                        damping: 30
                    }
                    }}>

                    <div className={styles.contenedor_img}>
                        <img className={styles.img_style} src="/background_parallax/layer_1.png" alt="Parallax Layer"></img>
                    </div>

                </ParallaxMousemove.Layer> 

            </div>

           </ParallaxMousemove>
        </div>
    )
}
